        var autocomplete = $(""#SurgeryOne"").data(""kendoAutoComplete"");
        if (autocomplete !== undefined) {
            let item = autocomplete.dataItem();
            if (item !== undefined && item !== null) {
                doctorId = item.Guid;
            }
